CREATE TABLE mytable(
   Tow_Date           DATE  NOT NULL PRIMARY KEY
  ,Make               VARCHAR(4)
  ,Style              VARCHAR(2)
  ,Model              VARCHAR(3)
  ,Color              VARCHAR(3)
  ,Plate              VARCHAR(8)
  ,State              VARCHAR(2)
  ,Towed_to_Address   VARCHAR(50) NOT NULL
  ,Tow_Facility_Phone VARCHAR(14)
  ,Inventory_Number   INTEGER  NOT NULL
);
